begin
wwv_flow_imp_shared.create_automation(
 p_id=>wwv_flow_imp.id(19107066553663130)
,p_name=>'Process Draft Swift Documents'
,p_static_id=>'process-draft-swift-documents'
,p_trigger_type=>'POLLING'
,p_polling_interval=>'FREQ=MINUTELY;INTERVAL=1'
,p_polling_status=>'DISABLED'
,p_result_type=>'ALWAYS'
,p_use_local_sync_table=>false
,p_include_rowid_column=>false
,p_commit_each_row=>false
,p_error_handling_type=>'IGNORE'
);
wwv_flow_imp_shared.create_automation_action(
 p_id=>wwv_flow_imp.id(19107387955663352)
,p_automation_id=>wwv_flow_imp.id(19107066553663130)
,p_name=>'Process Draft Documents'
,p_execution_sequence=>10
,p_action_type=>'NATIVE_PLSQL'
,p_action_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'p_tokens apex_t_varchar2;',
'p_text clob;',
'p_doc_id number;',
'p_ref varchar2(500);',
'p_source_file clob;',
'p_id number;',
'begin',
'--  fetch all draft documents and process then into do_references table',
'for d in (select * from swift_document where status=''draft'' or status is null) loop',
'        p_id := d.id;',
'        -- select source_file into p_source_file from swift_document where id=p_id;',
'        p_source_file := d.source_file;',
'        --  we test yhe trigger code and see that things work well',
'        p_tokens := apex_string.split(p_source_file,''$'');',
'        for i in 1..p_tokens.count loop',
'            p_text := p_tokens(i);',
'            -- print out the text tokens',
'        -- dbms_output.put_line(''==========='');',
'            -- dbms_output.put_line(p_text);',
'            ---  review this function, why it does not get all the references ',
'            -- swift documents change a lot and then we miss some values',
'            p_ref := utl_swift.extract_reference(p_text);',
'            -- the refernce should be tag 20 but it is missing in ssome cases',
'            -- dbms_output.put_line(''Doc reference : ''||p_ref);',
'            --  this is the issue , we need to get the reference into the doc_refernces table',
'            insert into doc_references(doc_id,refno,text_data) values (p_id,p_ref,p_text);',
'            update swift_document set status=''done'' where id = p_id;',
'        end loop;',
'end loop;',
' -- comment out the exception blok so that we can see what the error really is ',
' /*',
' exception ',
' when others then null;',
' */',
'end;',
'',
'-- we need to extract the doc refrence and insert it into the doc_refrences table, ',
'-- lets test the trigger code and see whats happening',
'-- select * from  swift_document order by created_at desc fetch first 1 rows only',
'',
''))
,p_action_clob_language=>'PLSQL'
,p_location=>'LOCAL'
,p_stop_execution_on_error=>true
);
end;
