'p_url varchar2(4000) := v(''MAILER_URL'');',
'p_reset_url varchar2(500) := v(''PASSWORD_RESET_URL'');',
'json_string clob;',
'ret varchar2(32000);',
'begin ',
'auth.create_user(',
'P_USERNAME => :P5_EMAIL,',
'P_MOBILE => :P5_MOBILE,',
'P_FNAME => :P5_FNAME,',
'P_LNAME => :P5_LNAME,',
