'-- set the roles and tokens',
'p_token := helpers.generate_alphanum||''$''||helpers.unix_time;',
'update users set roles = :p5_roles,password_reset_token = p_token,',
'created_by = auth.user_id(:app_user) where username = :p5_email;',
'apex_json.initialize_clob_output;',
'apex_json.open_object;',
'apex_json.write(''email'', :p5_email);',
'apex_json.write(''key'', p_token);',
'apex_json.write(''url'',p_reset_url);',
'apex_json.close_object;',
'json_string := apex_json.get_clob_output;',
'apex_json.free_output;',
'apex_web_service.g_request_headers.delete();',
'apex_web_service.g_request_headers(1).name := ''Content-Type'';  ',
'apex_web_service.g_request_headers(1).value := ''application/json'';',
'ret := apex_web_service.make_rest_request(',
'         p_url => p_url,  ',
'         p_http_method => ''POST'',',
'         p_body => json_string',
'); ',
'exception when others then ',
'null;',
'end;'))
